import { Box, Button, MenuItem, Select, TextField } from "@mui/material";
import { Formik } from "formik";
import * as yup from "yup";
import useMediaQuery from "@mui/material/useMediaQuery";
import Header from "../../components/Header";
import { useState } from "react";

const Icform = () => {
  const isNonMobile = useMediaQuery("(min-width:600px)");
  const [specialization, setSpecialization] = useState('');

  const handleFormSubmit = (values) => {
    console.log(values);
  };

  const handleChangeSpecialization = (event) => {
    setSpecialization(event.target.value);
  };

  const checkoutSchema = yup.object().shape({
    icname: yup.string().required("Required"),
    iclocation: yup.string().required("Required"),
    icemployees: yup.string().when('specialization', {
      is: (val) => val === 'DV',
      then: yup.string().required('Required'),
      otherwise: yup.string()
    }),
    icprojects: yup.string().when('specialization', {
      is: (val) => val === 'DFT',
      then: yup.string().required('Required'),
      otherwise: yup.string()
    }),
    icclients: yup.string().when('specialization', {
      is: (val) => val === 'PD',
      then: yup.string().required('Required'),
      otherwise: yup.string()
    }),
  });

  const initialValues = {
    icname: "",
    iclocation: "",
    icemployees: "",
    icprojects: "",
    icclients: ""
  };

  return (
    <Box m="20px">
      <Header title="Create User" subtitle="Create a New User Profile" />
      <Formik
        onSubmit={handleFormSubmit}
        initialValues={initialValues}
        validationSchema={checkoutSchema}
      >
        {({
          values,
          errors,
          touched,
          handleBlur,
          handleChange,
          handleSubmit,
        }) => (
          <form onSubmit={handleSubmit}>
            <Box
              display="grid"
              gap="30px"
              gridTemplateColumns="repeat(4, minmax(0, 1fr))"
              sx={{
                "& > div": { gridColumn: isNonMobile ? undefined : "span 4" },
              }}
            >
              <Select
                fullWidth
                variant="filled"
                value={specialization}
                onChange={handleChangeSpecialization}
                name="specialization"
                label="Specialization"
                sx={{ gridColumn: "span 2" }}
              >
                <MenuItem value="DV">DV</MenuItem>
                <MenuItem value="DFT">DFT</MenuItem>
                <MenuItem value="PD">PD</MenuItem>
              </Select>
              {specialization && (
                <>
                  <TextField
                    fullWidth
                    variant="filled"
                    type="text"
                    label={`Number of Employees (${specialization})`}
                    onBlur={handleBlur}
                    onChange={handleChange}
                    value={values.icemployees}
                    name="icemployees"
                    error={!!touched.icemployees && !!errors.icemployees}
                    helperText={touched.icemployees && errors.icemployees}
                    sx={{ gridColumn: "span 2" }}
                  />
                  <TextField
                    fullWidth
                    variant="filled"
                    type="text"
                    label={`Number of Projects (${specialization})`}
                    onBlur={handleBlur}
                    onChange={handleChange}
                    value={values.icprojects}
                    name="icprojects"
                    error={!!touched.icprojects && !!errors.icprojects}
                    helperText={touched.icprojects && errors.icprojects}
                    sx={{ gridColumn: "span 2" }}
                  />
                  <TextField
                    fullWidth
                    variant="filled"
                    type="text"
                    label={`Number of Clients (${specialization})`}
                    onBlur={handleBlur}
                    onChange={handleChange}
                    value={values.icclients}
                    name="icclients"
                    error={!!touched.icclients && !!errors.icclients}
                    helperText={touched.icclients && errors.icclients}
                    sx={{ gridColumn: "span 2" }}
                  />
                </>
              )}
              <TextField
                fullWidth
                variant="filled"
                type="text"
                label="Location"
                onBlur={handleBlur}
                onChange={handleChange}
                value={values.iclocation}
                name="iclocation"
                error={!!touched.iclocation && !!errors.iclocation}
                helperText={touched.iclocation && errors.iclocation}
                sx={{ gridColumn: "span 4" }}
              />
            </Box>
            <Box display="flex" justifyContent="end" mt="20px">
              <Button type="submit" color="secondary" variant="contained">
                Create New User
              </Button>
            </Box>
          </form>
        )}
      </Formik>
    </Box>
  );
};

export default Icform;
